import React from "react";
import { useNavigate } from 'react-router-dom';
import "./feed.css";

const Feed = () => {
    const posts = [
        {"title": "Post 1", "description": "This is the first post", "Media": "Image", "Song": "Song 1"},  
    ];


    const navigate = useNavigate();

    const handleBackButton = () => {
        console.log("Go back clicked");
        navigate("/settings");
    };

    return (
        <div>
            <h1>Feed</h1>
        </div>
        
    );
};

export default Feed;
